import Button from 'react-bootstrap/Button';

const DeleteWorkout = () => {
    
    return(
        <>
        <br />
        <label>
            Käyttäjätunnus:
            <br />
            <input></input>
          </label>
          <br />
          <label>
            Salasana:
            <br />
            <input></input>
          </label>
          <br />
          <Button>Luo tili</Button>
          </>
    )
}
export default DeleteWorkout;
